import { BrowserRouter, Route,Routes } from 'react-router-dom';
import './App.css';
import AllProductsScreen from './screens/AllproductsScreen';
import HomeScreen from './screens/HomeScreen';


function App() {
  return (
    <div >
    <BrowserRouter>
    <Routes>
    <Route path="/products" element={<AllProductsScreen />} />
    </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
